-- Update the name of the clinician user
UPDATE ad_role r
SET name = c.name || ' ' || rl.name
FROM ad_ref_list rl
JOIN ad_reference ref
	ON ref.ad_reference_id = rl.ad_reference_id
CROSS JOIN ad_client c
WHERE ref.ad_reference_uu = '5b41f508-5ce5-4b42-80de-713e10580d51'
	AND c.ad_client_id = r.ad_client_id
	AND r.name = c.name || ' Clinician User'
	AND rl.ad_ref_list_uu = '2a444310-ac8b-4e40-a0b9-fc6d1e66dc41';

-- Add the new roles
DROP TABLE IF EXISTS tmp_ad_role;
CREATE TEMP TABLE tmp_ad_role
(
	ad_role_id serial not null,
	ad_client_id numeric(10) not null,
	ad_org_id numeric(10) not null,
	isactive char default 'Y'::bpchar not null,
	created timestamp default now() not null,
	createdby numeric(10) not null,
	updated timestamp default now() not null,
	name varchar(200) not null,
	updatedby numeric(10) not null,
	description varchar(255),
	userlevel char(3) default '  O'::bpchar not null,
